const InputId = styled.input``;
const InputPW = styled(InputId)``;
const ButtonContainer= styled.div``;


const Login =() =>{

    return (
        <>
        <Title>이화인들을 위한, 이화인들에 의한 개발자 커뮤니티</Title>
        <Container>

            <InputContainer>
               <InputId />
               <InputPW />
            </InputContainer>

        </Container>
        <ButtonContainer>

        </ButtonContainer>
        </>
    )

}

export default Login;
